Also Hascal can include C++ headers in your program. We need two files, one for headers and one for main part of the library. You should put #include,... in your_cpp_lib.hpp and main part of library in your_cpp_lib.cc. The specified files should exist in the same folder. See the example below: add.cc : void __hascal__cpp_print(int x){ printf("%d",x);
} add __hascal__ to your C++ functions, structs name. Hascal transpiles to C++ and it adds __hascal__ prefix to your C++ names. add.hpp : #include <cstdio> main.has : cuse add function cpp_print(x:int) function main() : int { cpp_print(12) return 0
} Also you can put the C++ files in a folder and rename they to _.cc and _.hpp. Note that don't include local headers in *.hpp file.

